import {rahul} from 'assets/img/image/teams/team19/Rahul Aggarwal.webp';

const teamStyle = {
  root: {
    flexGrow: 1,
  },
  box: {
    marginLeft: '6vw',
    marginTop: '10vh',  
    boxShadow: '0px 5px 7px 7px #888888',
    height: '30vh',
  },
  imag: {
      margin: 'auto',
      height: '18vh',
      width: '9vw',
  },
  rahul: {
    marginLeft: '6vw',
    marginTop: '10vh',  
    boxShadow: '0px 5px 7px 7px #888888',
    height: '30vh',
    backgroundImage: "url("+ {rahul} +")",
    backgroundSize: 'cover',
    overflow: 'hidden',
  }
}

export default teamStyle;
